(53, 'Kompetisi Sains', 'Kompetisi Sains 2025 hadir buat kamu para inovator muda yang suka tantangan! \r\nTunjukkan kemampuanmu dalam memecahkan masalah ilmiah, berinovasi, dan berpikir out of the box!\r\nBukan cuma lomba, tapi juga ajang seru buat belajar, berkolaborasi, dan jadi bagian dari generasi sains masa depan! ', '2025-11-06', '10:42:00', NULL, 'Auditorium SMKN 4 Bogor', 'akademik', 0.00, NULL, 1, 'flyers/JMSlYzgX0weSKiTwxFaJbMnYNuI86XJNdPk8aZwo.jpg', NULL, NULL, 1, '2025-11-06 03:42:00', 2, NULL, '2025-11-05 20:37:46', '2025-11-05 20:37:46'),
(54, 'Lari Bersama Kr4bat', ' Lari Bersama KR4BAT  bukan sekadar lari, tapi ajang seru bareng temen-temen satu vibe! \r\nSiapkan sepatu terbaikmu, panaskan semangatmu, dan nikmati pagi penuh energi bareng KR4BAT! Dijamin bikin sehat, seru, dan tambah solid bareng komunitas kece ini! ', '2025-11-09', '07:00:00', NULL, 'SMKN 4 Bogor', 'olahraga', 10000.00, NULL, 0, 'flyers/RHgtzIxcy9KweZBaYQVFpAcf4V1l7luqtXtlO8ZP.jpg', NULL, NULL, 1, '2025-11-09 00:00:00', 2, NULL, '2025-11-05 22:26:10', '2025-11-05 22:26:10'),
(55, 'Pagelaran Wayang Kulit', 'Malam penuh magi dan budaya! Saksikan kisah klasik nusantara yang hidup kembali lewat bayangan dan gamelan yang memukau. Rasakan aura tradisi dalam sentuhan modern yang bikin merinding kagum!', '2025-11-18', '09:10:00', NULL, 'Ruang Seni SMKN 4 Bogor', 'seni_budaya', 30000.00, 300, 0, 'flyers/93dNpmOObi451HftUtSw4IB9s4NXCgzzSnurVxsR.jpg', NULL, NULL, 1, '2025-11-18 02:10:00', 2, 'HINDIA', '2025-11-10 20:21:09', '2025-11-10 20:36:31'),
(56, 'Perkemahan Tamu Galang', 'Serunya kebersamaan di alam terbuka! Penuh tawa, petualangan, dan pentas seni seru yang bakal bikin momen camping kali ini unforgettable banget! Siap jadi Galang paling keren?', '2025-11-17', '07:30:00', NULL, 'Buper SMKN 4 Bogor', 'seni_budaya', 100000.00, NULL, 0, 'flyers/d8MgHtKDDlgFwqM49pBigsQORriBd7JaPicKUJML.jpg', NULL, NULL, 1, '2025-11-17 00:30:00', 2, 'KAMUSNGRAT', '2025-11-10 20:23:31', '2025-11-10 20:24:09'),
(57, 'Fun Run Sejuta Langkah', 'Bangun pagi, semangat tinggi! Ayo gabung di Fun Run paling seru  lari bareng, dapet keringat, dapet vibes positif! Bukan soal siapa cepat, tapi siapa yang paling happy di garis finish!', '2025-11-20', '06:30:00', NULL, 'Lapangan Sempur', 'olahraga', 60000.00, NULL, 0, 'flyers/wyoTIETHlfcDGp65cJZs9xRQPBZ9IikwUlh5eMxj.jpg', NULL, NULL, 1, '2025-11-19 23:30:00', 2, 'KLSI', '2025-11-10 20:39:46', '2025-11-10 20:39:46'),
(58, 'CLASSWARS 2025', 'Fun, Friendship, and Freedom!\r\nLepas penat, nyalain semangat! Classmeet kali ini hadir dengan vibes baru  penuh musik, tawa, dan keseruan antar kelas. Jangan cuma nonton, jadi bagian dari keseruannya!', '2025-11-21', '08:00:00', NULL, 'SMKN 4 Bogor', 'akademik', 0.00, NULL, 1, 'flyers/WnrzyRIfkvb29fxa7Rl71jdzuWNFfbjWqvOFEnPt.jpg', NULL, NULL, 1, '2025-11-21 01:00:00', 2, 'OSISK4', '2025-11-12 22:18:07', '2025-11-12 22:18:36'),
(59, 'CAREFEST 2025', 'Festival sosial yang jadi wadah buat menebar kebaikan! Ada penggalangan dana, kunjungan ke panti, dan kegiatan peduli lingkungan. Yuk, buktikan kalau anak muda juga bisa berdampak besar untuk sekitar!', '2025-11-22', '09:23:00', NULL, 'Panti Cinta Asih', 'sosial', 30000.00, NULL, 0, 'flyers/EF0QD1LQjLXFeJCan1SjEqrAhH9sMbpudCghK7ER.jpg', NULL, NULL, 1, '2025-11-22 02:23:00', 2, 'AVISA', '2025-11-12 22:24:42', '2025-11-12 22:24:42');
